class Solution {
    /**
    Circular shift the digits of the integer x, shift the digits right by shift
    and return the result as a string.
    If shift > number of digits, return digits reversed.
    >>> circularShift(12, 1)
    "21"
    >>> circularShift(12, 2)
    "12"
     */
    public String circularShift(int x, int shift) {
        // Convert the number to a string to easily manipulate digits
        String numStr = Integer.toString(x);
        int length = numStr.length();

        // If shift is greater than or equal to the number of digits, return the reversed string
        if (shift >= length) {
            return new StringBuilder(numStr).reverse().toString();
        }

        // Perform circular shift
        int effectiveShift = shift % length;
        String shiftedPart = numStr.substring(length - effectiveShift);
        String remainingPart = numStr.substring(0, length - effectiveShift);

        // Concatenate the shifted part with the remaining part
        return shiftedPart + remainingPart;
    }
}
public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.circularShift(100, 2).equals("001"),
                s.circularShift(12, 2).equals("12"),
                s.circularShift(97, 8).equals("79"),
                s.circularShift(12, 1).equals("21"),
                s.circularShift(11, 101).equals("11")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
