class Solution {
    /**
    Input is a space-delimited string of numberals from 'zero' to 'nine'.
    Valid choices are 'zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight' and 'nine'.
    Return the string with numbers sorted from smallest to largest
    >>> sortNumbers("three one five")
    "one three five"
     */
    public String sortNumbers(String numbers) {
        // Split the input string into an array of numbers
        String[] numberArray = numbers.split(" ");

        // Initialize an empty list to store the sorted numbers
        List<Integer> sortedNumbers = new ArrayList<>();

        // Iterate over each number in the array
        for (String number : numberArray) {
            // Convert the number to an integer and add it to the sorted list
            sortedNumbers.add(Integer.parseInt(number));
        }

        // Sort the list of integers
        Collections.sort(sortedNumbers);

        // Convert the sorted list back to a string and return it
        return String.join(" ", sortedNumbers);
    }
}
