    true
    >>> triplesSumToZero(Arrays.asList(1))
    false
     */
    public boolean triplesSumToZero(List<Integer> l) {
        // Check if there are at least three distinct elements
        if (l.size() < 3) {
            return false;
        }

        // Sort the list to make it easier to find the triplets
        Collections.sort(l);

        // Iterate through the list, considering each element as the first element of the triplet
        for (int i = 0; i < l.size() - 2; i++) {
            // Use two pointers to find the other two elements
            int left = i + 1;
            int right = l.size() - 1;

            while (left < right) {
                int sum = l.get(i) + l.get(left) + l.get(right);

                if (sum == 0) {
                    return true;
                } else if (sum < 0) {
