class Solution {
    /**
    Check if in given list of numbers, are any two numbers closer to each other than given threshold.
    >>> hasCloseElements(Arrays.asList(1.0, 2.0, 3.0), 0.5)
    false
    >>> hasCloseElements(Arrays.asList(1.0, 2.8, 3.0, 4.0, 5.0, 2.0), 0.3)
    true
     */
    public boolean hasCloseElements(List<Double> numbers, double threshold) {
        if (numbers == null || numbers.size() < 2) {
            return false;
        }

        // Use a priority queue to keep track of the smallest differences
        PriorityQueue<Double> minDifferenceQueue = new PriorityQueue<>();

        for (int i = 0; i < numbers.size(); i++) {
            for (int j = i + 1; j < numbers.size(); j++) {
                double difference = Math.abs(numbers.get(i) - numbers.get(j));
                if (difference < threshold) {
                    minDifferenceQueue.offer(difference);
                }
            }
        }

        // Check if the smallest difference is less than the threshold
        return !minDifferenceQueue.isEmpty() && minDifferenceQueue.peek() < threshold;
    }
