import java.util.*;
import java.lang.*;

class Solution {
    /**
    Given list of integers, return list in strange order.
    Strange sorting, is when you start with the minimum value,
    then maximum of the remaining integers, then minimum and so on.

    Examples:
    strangeSortList(Arrays.asList(1, 2, 3, 4)) == Arrays.asList(1, 4, 2, 3)
    strangeSortList(Arrays.asList(5, 5, 5, 5)) == Arrays.asList(5, 5, 5, 5)
    strangeSortList(Arrays.asList()) == Arrays.asList()
     */
    public List<Integer> strangeSortList(List<Integer> lst) {
        // Sort the list in ascending order
        Collections.sort(lst);

        // Initialize an empty list to store the result
        List<Integer> result = new ArrayList<>();

        // Use two pointers to pick elements from the sorted list
        int left = 0;
        int right = lst.size() - 1;

        // Alternate between picking the smallest and largest remaining elements
        while (left <= right) {
            if (left == right) {
                // If there's only one element left, add it to the result
                result.add(lst.get(left));
            } else {
                // Add the smallest remaining element
                result.add(lst.get(left));
                // Add the largest remaining element
                result.add(lst.get(right));
            }
            left++;
            right--;
        }

        return result;
    }
}
public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.strangeSortList(new ArrayList<>(Arrays.asList(1, 2, 3, 4))).equals(Arrays.asList(1, 4, 2, 3)),
