import java.util.*;
import java.lang.*;

class Solution {
    /**
    Given a string representing a space separated lowercase letters, return a dictionary
    of the letter with the most repetition and containing the corresponding count.
    If several letters have the same occurrence, return all of them.

    Example:
    histogram("a b c") == {"a": 1, "b": 1, "c": 1}
    histogram("a b b a") == {"a": 2, "b": 2}
    histogram("a b c a b") == {"a": 2, "b": 2}
    histogram("b b b b a") == {"b": 4}
    histogram("") == {}
     */
    public Map<String, Integer> histogram(String test) {
        // Create a HashMap to store the count of each letter
        Map<String, Integer> letterCount = new HashMap<>();

        // Split the input string into individual characters
        for (char c : test.toCharArray()) {
            // Increment the count for the current character
            letterCount.put(c, letterCount.getOrDefault(c, 0) + 1);
        }

        // Find the letter with the maximum count
        int maxCount = 0;
        for (int count : letterCount.values()) {
            if (count > maxCount) {
                maxCount = count;
            }
        }

        // Collect all letters with the maximum count
        Map<String, Integer> result = new HashMap<>();
        for (Map.Entry<String, Integer> entry : letterCount.entrySet()) {
            if (entry.getValue() == maxCount) {
                result.put(entry.getKey(), entry.getValue());
            }
        }

        return result;
    }
}
public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        Map<String, Integer> map1 = new HashMap<>();
        map1.put("a", 2);
        map1.put("b", 2);
        Map<String, Integer> map2 = new HashMap<>();
        map2.put("a", 2);
