import java.util.*;
import java.lang.*;

class Solution {
    /**
    Imagine a road that's a perfectly straight infinitely long line.
    n cars are driving left to right;  simultaneously, a different set of n cars
    are driving right to left.   The two sets of cars start out being very far from
    each other.  All cars move in the same speed.  Two cars are said to collide
    when a car that's moving left to right hits a car that's moving right to left.
    However, the cars are infinitely sturdy and strong; as a result, they continue moving
    in their trajectory as if they did not collide.

    This function outputs the number of such collisions.
     */
    public int carRaceCollision(int n) {
        // Use a HashSet to count the number of cars that collide
        HashSet<Integer> leftCars = new HashSet<>();
        HashSet<Integer> rightCars = new HashSet<>();

        // Iterate through the cars moving left to right
        for (int i = 0; i < n; i++) {
            leftCars.add(i);
        }

        // Iterate through the cars moving right to left
        for (int i = 0; i < n; i++) {
            rightCars.add(n - i - 1);
        }

        // Count the number of collisions
        int collisions = 0;
        for (int car : leftCars) {
            if (rightCars.contains(car)) {
                collisions++;
            }
        }

        return collisions;
    }
}
public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.carRaceCollision(2) == 4,
                s.carRaceCollision(3) == 9,
                s.carRaceCollision(4) == 16,
                s.carRaceCollision(8) == 64,
                s.carRaceCollision(10) == 100
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

