import java.util.*;
import java.lang.*;

class Solution {
    /**
    Task
    We are given two strings s and c, you have to deleted all the characters in s that are equal to any character in c
    then check if the result string is palindrome.
    A string is called palindrome if it reads the same backward as forward.
    You should return a tuple containing the result string and true/false for the check.
    Example
    For s = "abcde", c = "ae", the result should be ("bcd",false)
    For s = "abcdef", c = "b"  the result should be ("acdef",false)
    For s = "abcdedcba", c = "ab", the result should be ("cdedc",true)
     */
    public List<Object> reverseDelete(String s, String c) {
        // Step 1: Remove characters in s that are equal to any character in c
        Set<Character> cSet = new HashSet<>();
        for (char c : c.toCharArray()) {
            cSet.add(c);
        }
        StringBuilder result = new StringBuilder();
        for (char c : s.toCharArray()) {
            if (!cSet.contains(c)) {
                result.append(c);
            }
        }

        // Step 2: Reverse the result string
        result.reverse();

        // Step 3: Check if the result string is a palindrome
        Set<Character> cSet2 = new HashSet<>();
        for (char c : c.toCharArray()) {
            cSet2.add(c);
        }
        boolean isPalindrome = true;
        for (char c : result.toString().toCharArray()) {
            if (!cSet2.contains(c)) {
                isPalindrome = false;
                break;
            }
        }

        // Step 4: Return the result as a list
        List<Object> resultList = new ArrayList<>();
        resultList.add(result.toString());
        resultList.add(isPalindrome);
        return resultList;
    }
}
public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.reverseDelete("abcde", "ae" ).equals(Arrays.asList("bcd", false)),
