     */
    public List<Integer> getOddCollatz(int n) {
        List<Integer> oddNumbers = new ArrayList<>();
        while (n != 1) {
            if (n % 2 != 0) {
                oddNumbers.add(n);
            }
            n = n % 2 == 0 ? n / 2 : 3 * n + 1;
        }
        oddNumbers.add(1); // Add 1 to the list as it is the only odd number in the sequence
        Collections.sort(oddNumbers); // Sort the list in ascending order
        return oddNumbers;
    }
}
