class Solution {
    /**
    Your task is to implement a function that will simplify the expression
    x * n. The function returns true if x * n evaluates to a whole number and false
    otherwise. Both x and n, are string representation of a fraction, and have the following format,
    <numerator>/<denominator> where both numerator and denominator are positive whole numbers.

    You can assume that x, and n are valid fractions, and do not have zero as denominator.

    simplify("1/5", "5/1") = true
    simplify("1/6", "2/1") = false
    simplify("7/10", "10/2") = false
     */
    public boolean simplify(String x, String n) {
        // Split the fractions into numerator and denominator
        String[] partsX = x.split("/");
        String[] partsN = n.split("/");

        // Convert the string representations to integers
        int numeratorX = Integer.parseInt(partsX[0]);
        int denominatorX = Integer.parseInt(partsX[1]);
        int numeratorN = Integer.parseInt(partsN[0]);
        int denominatorN = Integer.parseInt(partsN[1]);

        // Calculate the greatest common divisor (GCD) of the denominators
        int gcd = gcd(denominatorX, denominatorN);

        // Simplify the fraction by dividing both the numerator and the denominator by the GCD
        numeratorX /= gcd;
        denominatorX /= gcd;

        // Check if the simplified numerator is a whole number
        return numeratorX % 1 == 0;
    }

    // Helper method to calculate the greatest common divisor of two numbers
    private int gcd(int a, int b) {
        while (b != 0) {
            int temp = b;
            b = a % b;
            a = temp;
        }
        return a;
    }
}
public class Main {
