class Solution {
    /**
    You are given an array arr of integers and you need to return
    sum of magnitudes of integers multiplied by product of all signs
    of each number in the array, represented by 1, -1 or 0.
    Note: return None for empty arr.

    Example:
    >>> prodSigns(Arrays.asList(1, 2, 2, -4)) == -9
    >>> prodSigns(Arrays.asList(0, 1)) == 0
    >>> prodSigns(Arrays.asList()) == None
     */
    public Optional<Integer> prodSigns(List<Integer> arr) {
        if (arr.isEmpty()) {
            return Optional.empty();
        }

        int signProduct = 1;
        int magnitudeProduct = 1;

        for (int num : arr) {
            if (num == 0) {
                return Optional.of(0);
            }

            if (num < 0) {
                signProduct *= -1;
            }
            magnitudeProduct *= Math.abs(num);
        }

        return Optional.of(magnitudeProduct * signProduct);
    }
}
