class Solution {
    /**
    Given a list of numbers, return the sum of squares of the numbers
    in the list that are odd. Ignore numbers that are negative or not integers.

    doubleTheDifference(Arrays.asList(1, 3, 2, 0)) == 1 + 9 + 0 + 0 = 10
    doubleTheDifference(Arrays.asList(-1, -2, 0)) == 0
    doubleTheDifference(Arrays.asList(9, -2)) == 81
    doubleTheDifference(Arrays.asList(0)) == 0

    If the input list is empty, return 0.
     */
    public int doubleTheDifference(List<Object> lst) {
        if (lst.isEmpty()) {
            return 0;
        }

        // Convert all elements to integers and filter out non-integer and negative numbers
        List<Integer> filteredList = lst.stream()
                .filter(item -> item instanceof Integer && item > 0)
                .mapToInt(Integer::intValue)
                .boxed()
                .collect(Collectors.toList());

        // Calculate the sum of squares of the remaining numbers
        int sumOfSquares = filteredList.stream()
                .mapToInt(Integer::intValue)
                .map(i -> i * i)
                .sum();

        return sumOfSquares;
    }
}
