                s.compare(Arrays.asList(1, 2, 3, 5), Arrays.asList(-1, 2, 3, 4)).equals(Arrays.asList(2, 0, 0, 1))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

